using Microsoft.AspNetCore.Http;

namespace UFSQQFacilities.Data
{
    public static class SeedData
    {
        public static void EnsurePopulated(IApplicationBuilder app)
        {
            AppDbContext context = app.ApplicationServices.CreateScope()
                .ServiceProvider.GetRequiredService<AppDbContext>();

            if (context.Database.GetPendingMigrations().Any())
                context.Database.Migrate();

            if (!context.Facilities.Any())
            {
                context.Facilities.AddRange(
                     new Facility()
                     {
                         Name = "Gym",
                         Space = 50,
                         Price = 100,
                         Description = "Take your strength training into new heights with our extensive collection of equipment."
                     },
                     new Facility()
                     {
                         Name = "Laundry",
                         Space = 10,
                         Price = 50,
                         Description = "Make your laundry experience more convinient, we offer additional amenities so take advantage" +
                                    " of our laundry facility."
                     },
                     new Facility()
                     {
                         Name = "Parking Services",
                         Space = 40,
                         Price = 80,
                         Description = "Designed to offer a seamless parking experience, ensuring your peace of mind."
                     },
                     new Facility()
                     {
                         Name = "Library discussion rooms",
                         Space = 60,
                         Price = 50,
                         Description = "We offer dedicated discussion rooms where individuals and groups can come together for productive" +
                                    " and insightful conversations."
                     }
                   );
            }
            context.SaveChanges();


            if (!context.Images.Any())
            {
                context.Images.AddRange(
                    new FacilityImage() { FacilityId = 1, Image = HexToBytes("") },
                    new FacilityImage() { FacilityId = 1, Image = HexToBytes("") },
                    new FacilityImage() { FacilityId = 4, Image = HexToBytes("") },
                    new FacilityImage() { FacilityId = 4, Image = HexToBytes("") },
                    new FacilityImage() { FacilityId = 3, Image = HexToBytes("") },
                    new FacilityImage() { FacilityId = 3, Image = HexToBytes("") },
                    new FacilityImage() { FacilityId = 2, Image = HexToBytes("") },
                    new FacilityImage() { FacilityId = 2, Image = HexToBytes("") }
                );
            
            }
            context.SaveChanges();

            if (!context.Categories.Any())
            {
                context.Categories.AddRange(
                     new Category() { FacilityId = 1, CategoryName = "Free weights area" },
                     new Category() { FacilityId = 1, CategoryName = "Weight machine" },
                     new Category() { FacilityId = 1, CategoryName = "Elliptical machine" },
                     new Category() { FacilityId = 1, CategoryName = "Threadmill" },
                      new Category() { FacilityId = 1, CategoryName = "Powerhouse fitness plate-loaded machine" },
                     new Category() { FacilityId = 2, CategoryName = "Top Loader Washing machine" },
                     new Category() { FacilityId = 2, CategoryName = "Front Loader Washing machine" },
                     new Category() { FacilityId = 2, CategoryName = "Clothes dryer" },
                     new Category() { FacilityId = 2, CategoryName = "Ironing board" },
                     new Category() { FacilityId = 4, CategoryName = "Conference table" },
                     new Category() { FacilityId = 4, CategoryName = "Communal table" },
                     new Category() { FacilityId = 4, CategoryName = "Chairs" },
                     new Category() { FacilityId = 4, CategoryName = "Communal table" },
                     new Category() { FacilityId = 3, CategoryName = "Staff Parking Bay" },
                     new Category() { FacilityId = 3, CategoryName = "Student Parking Bay" },
                     new Category() { FacilityId = 3, CategoryName = "Visitor Parking Bay" }
                   );
            }
            context.SaveChanges();
        }

        private static byte[] HexToBytes(string hex)
        {
            try
            {
                var range = Enumerable.Range(0, hex.Length)
                       .Where(x => x % 2 == 0 && x + 2 <= hex.Length)
                       .Select(x =>
                       {
                           var substring = hex.Substring(x, Math.Min(2, hex.Length - x));
                           return Convert.ToByte(substring, 16);
                       })
                       .ToArray();

                return range;
            }
            catch { return new byte[0]; }
        }
    }
}
